CREATE DEFINER=`root`@`localhost` FUNCTION `create_employee`(p_employee_name varchar(50),p_address varchar(100), p_state varchar(20), p_city varchar(20),
p_postal_code int,p_phone varchar(50),p_start_date DATE, p_end_date DATE, p_salary float, p_email varchar(50), p_rating int, p_bonus float,
p_leaves_taken int, p_username varchar(50), p_password varchar(50), p_manager_username VARCHAR(20)) RETURNS varchar(20) CHARSET utf8mb4
    DETERMINISTIC
begin
declare l_region_id int;
declare l_emp_id int;
declare l_user_id int;
declare l_manager_id int;

select region_id into l_region_id
from regions r
where p_state = r.state_name
and p_city = r.city;

select m.manager_id into l_manager_id
from users u, manager m
where u.username = p_manager_username
and m.manager_emp_id = u.employee_id;

select max(user_id) +1 into l_user_id
from users;

set l_emp_id = gen_rand_emplid();

insert into employee(employee_id, first_name, last_name, email_id, status, salary, bonus, manager_id, 
emp_rating, leaves_taken, address, contact, start_date, end_date, creation_date, updated_date, region_id)
values (l_emp_id, TRIM(SUBSTRING_INDEX(p_employee_name,' ',1)), TRIM(SUBSTRING_INDEX(p_employee_name,' ',-1)),
p_email, 'Active', p_salary,  p_bonus, l_manager_id, p_rating, p_leaves_taken, 
concat(p_address,', ',p_city,', ',p_state,', ',p_postal_code), p_phone, p_start_date, p_end_date,
now(), now(), l_region_id);


INSERT INTO users (user_id, username, pwd, creation_date, updated_date, customer_id, employee_id, user_role_id)
    VALUES (l_user_id, p_Username, md5(p_Password), NOW(), NOW(),null,l_emp_id , 3);

RETURN 'Success';

end ;;
