CREATE DEFINER=`root`@`localhost` FUNCTION `InsertCustomerAndUser`(
     p_FirstName VARCHAR(20),
     p_LastName VARCHAR(30),
     p_EmailID VARCHAR(50),
     p_Contact VARCHAR(12),
     p_Address VARCHAR(200),
     p_Username VARCHAR(30),
     p_Password VARCHAR(30),
     p_state    VARCHAR(50),
     p_city		VARCHAR(100),
     p_zip_code INT
) RETURNS varchar(20) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
    DECLARE l_customer_id INT;
    DECLARE l_user_id INT;
    DECLARE l_region_id INT;
    DECLARE l_address VARCHAR(200);
    
    select max(customer_id) + 1
     into l_customer_id
     from customer;
    
    select max(user_id) + 1
      into l_user_id
      from users;
    
    select region_id
      into l_region_id
      from regions
	where state_name = p_state
      and city = p_city;
      
   SET l_address = CONCAT(p_address,', ',p_city,', ',p_state,' ',p_zip_code);   
    
    -- Insert into customer table
    INSERT INTO customer (customer_id, first_name, last_name, email_id, contact, address, creation_date, updated_date,
                          status, region_id)
    VALUES (l_customer_id, p_FirstName, p_LastName, p_EmailID, p_Contact, l_address, NOW(),NOW(), 'ACTIVE', l_region_id);

    -- Insert into users table
    INSERT INTO users (user_id, username, pwd, creation_date, updated_date, customer_id, employee_id, user_role_id)
    VALUES (l_user_id, p_Username, md5(p_Password), NOW(), NOW(), l_customer_id, NULL, 1);
    
    RETURN l_user_id;
