CREATE DEFINER=`root`@`localhost` FUNCTION `InsertFeedback`(p_username VARCHAR(200), 
                               p_order_id INT, 
                               p_rating INT, 
                               p_comments VARCHAR(2000),
                               p_issue_category VARCHAR(200)) RETURNS int
    DETERMINISTIC
BEGIN
  DECLARE l_record_id INT;
  DECLARE l_customer_id INT;
  DECLARE l_employee_id INT;
  
  SELECT MAX(record_id) + 1 
    INTO l_record_id 
    FROM feedback;
  
  SELECT customer_id
    INTO l_customer_id
    FROM users u
    WHERE u.username = p_username;
    
  select employee_id
    into l_employee_id
    from orders
    where order_id = p_order_id;
    
  IF p_issue_category IS NOT NULL
  THEN
    INSERT INTO feedback (record_id, record_type, order_id, grevience_category, status, customer_id, comments, emp_id, creation_date, updated_date)
    VALUES (l_record_id, 'GREVIANCE', p_order_id, p_issue_category, 'Open', l_customer_id, p_comments, l_employee_id, NOW(), NOW());	
  ELSE
     INSERT INTO feedback (record_id, record_type, order_id, rating, status, customer_id, comments, emp_id, creation_date, updated_date)
     VALUES (l_record_id, 'FEEDBACK', p_order_id, p_rating, 'N/A', l_customer_id, p_comments, l_employee_id, NOW(), NOW());
  END IF;
  RETURN l_record_id;
END ;;
