CREATE DEFINER=`root`@`localhost` FUNCTION `InsertOrderDetails`( p_order_id INT
                   , p_product_id VARCHAR(200)
                   , p_quantity FLOAT
                                   , p_discount FLOAT
                                   , p_price FLOAT) RETURNS int
    DETERMINISTIC
BEGIN
  declare l_order_detail_id INT;
  
  select max(order_detail_id)+1 
  into l_order_detail_id 
    from order_details;
  
  INSERT INTO order_details (order_detail_id, order_id, product_id, quantity, discount, price, creation_date, updated_date)
    VALUES (l_order_detail_id, p_order_id, p_product_id, p_quantity, round(p_discount,2), round(p_price,2), now(), now());
  
  update products
  set quantity = quantity - p_quantity, updated_date = now()
  where product_id = p_product_id;
  
  RETURN l_order_detail_id;
END ;;
