CREATE DEFINER=`root`@`localhost` FUNCTION `InsertWarehouseInventory`(p_warehouse_id INT,
                      p_product_id VARCHAR(50),
                                          p_quantity INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE l_warehouse_inv_id INT;
    
    select max(warehouse_inv_id)
    INTO l_warehouse_inv_id
    from warehouse_inventory
    where warehouse_id = p_warehouse_id
