CREATE DEFINER=`root`@`localhost` FUNCTION `UpdateProductInventory`(
    p_supply_order_id INT
) RETURNS varchar(20) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
    DECLARE l_quantity INT;
    DECLARE l_product_id VARCHAR(20);
    
    select qty_ordered, product_id
    into l_quantity, l_product_id
    from warehouse_supply ws, warehouse_inventory wi
    where ws.supply_order_id = p_supply_order_id
    and wi.warehouse_inv_id = ws.warehouse_inv_id;
    
    update products
    set quantity = quantity+l_quantity,
    updated_date = now(),
    inventory_status = 'In Stock'
    where product_id = l_product_id;
    
    update warehouse_supply
    set shipment_status = 'Delivered'
    where supply_order_id = p_supply_order_id;
    
    RETURN 'Success';
END ;;
DELIMITER ;
