CREATE DEFINER=`root`@`localhost` FUNCTION `update_employee`(p_employee_name varchar(50),p_address varchar(100), p_state varchar(20), p_city varchar(20),
p_postal_code int,p_phone varchar(50), p_end_date DATE, p_salary float, p_email varchar(50), p_rating int, p_bonus float,
p_leaves_taken int) RETURNS varchar(20) CHARSET utf8mb4
    DETERMINISTIC
begin 
declare l_employee_id int;
declare l_region_id int;

select region_id into l_region_id
from regions
where p_state = state_name
and p_city = city;

select employee_id into l_employee_id
from employee
where concat(first_name,' ', last_name) = p_employee_name;

update employee
set address = concat(p_address ,', ',p_city, ', ',p_state,', ',p_postal_code),
	contact = p_phone, 
    end_date = p_end_date, 
    Salary = p_salary, 
    email_id = p_email,
    emp_rating = p_rating , 
    bonus = p_bonus,
	leaves_taken = p_leaves_taken,
    region_id = l_region_id
where employee_id = l_employee_id;

return 'Success';
end ;;
