CREATE DEFINER=`root`@`localhost` PROCEDURE `update_orders_employee_id`()
BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE order_id_var INT;
    DECLARE employee_id_var INT;

    -- Declare a cursor for the SELECT query
    DECLARE cur CURSOR FOR
        SELECT od.order_id, e.employee_id
        FROM orders od
        JOIN employee e ON od.order_id = CEIL(e.employee_id / 3000)
        WHERE NOT EXISTS (
            SELECT 1 FROM orders WHERE employee_id = e.employee_id
        )
        ORDER BY od.order_id;

    -- Declare handler for NOT FOUND condition
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    -- Open the cursor
    OPEN cur;

    -- Start the loop
    cursor_loop: LOOP
        -- Fetch the next row into variables
        FETCH cur INTO order_id_var, employee_id_var;

        -- Check if we have reached the end of the result set
        IF done = 1 THEN
            LEAVE cursor_loop;
        END IF;

        -- Update the orders table
        UPDATE orders
        SET employee_id = employee_id_var
        WHERE order_id = order_id_var;

    END LOOP cursor_loop;

    -- Close the cursor
    CLOSE cur;

END ;;
DELIMITER ;
